import './index.css';
import React from 'react';
import ReactDOM from 'react-dom';
import TaskFrame from './TaskFrame.js';
import StatsViewer from './StatsViewer.js';
import UserForm from './UserForm.js';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function TaskManager() {
  return (
    <Router >
      <div >
        <div className="navbar navbar-default">
          <div id="taskNav" >
            <div className="container">
              <div className="bar1"></div>
              <div className="bar2"></div>
              <div className="bar3"></div>
            </div>
            <ul className="nav navbar-nav">
              <li className="nav-item">
                <Link className="nav-link" to="/home">AwesomeTask</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/compose">New Task</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/stats">Statistics</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/user">User</Link>
              </li>
            </ul>
          </div>
        </div>
        <div className="mainTest">
          <Route exact path="/home" component={TaskFrame} />
          <Route exact path="/compose" component={TaskFrame} />

        </div>
      </div>
    </Router>
  );
}

ReactDOM.render(<TaskManager />, document.getElementById('root'));

export default TaskManager;
